import React from "react"; 

function Input(props){
    let [color, setColor] = React.useState("red")
  return(
    <div>
      <input type="text" value={color} onChange={(event)=>{
          setColor(event.target.value);
      }}/>
      <button>{props.label}</button>
    </div>
  )
}

export default Input;
